import React from 'react';
import {useNavigate} from "react-router-dom";
import {useGlobalContext} from "../context";

const Dashboard = () => {
    const {user} = useGlobalContext();
    const navigate = useNavigate();
    if (!user) {
        navigate('/');
    }
    return (
        <div className='info'>
            <h2>
                <span>Dashboard</span>
            </h2>
            <p>
                Hello ${user}
            </p>
        </div>
    );
};

export default Dashboard;
